import React, { useContext, useEffect, useState } from 'react';
import { View, Text, FlatList, TouchableOpacity, StyleSheet, TextInput, Alert } from 'react-native';
import Axios from 'axios';
import { Ionicons } from '@expo/vector-icons';
import FooterMenuItem from '../components/Menu';
import { AuthContext } from '../context/authorization';

const UsersScreen = ({navigation}) => {
  const [state] = useContext(AuthContext);
  const userId = state?.user?._id;
  // console.log(userId)
  const [quickAddUsers, setQuickAddUsers] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredUsers, setFilteredUsers] = useState([]);
  

  useEffect(() => {
    const fetchData = async () => {
      try {
        const quickAddResponse = await Axios.get(`/auth/allusers/${userId}`);
        setQuickAddUsers(quickAddResponse.data);
        setFilteredUsers(quickAddResponse.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, [userId]);

  useEffect(() => {
    
    if (searchQuery) {
      const filtered = quickAddUsers.filter((user) =>
        user.name.toLowerCase().includes(searchQuery.toLowerCase())
      );
      setFilteredUsers(filtered);
    } else {
      setFilteredUsers(quickAddUsers);
    }
  }, [searchQuery, quickAddUsers]);

  const sendFriendRequest = async (userId) => {
    try {
      const response = await Axios.post('/auth/createRoom', {
        receiverId: userId,
        senderId: state.user._id,
      });
  
      if (response.status === 201) {
        Alert.alert('Friend Request Sent', 'Your friend request was sent successfully.');
      }
    } catch (error) {
      if (error.response && error.response.status === 400) {
        Alert.alert('Friend Request Error', 'You have already sent a friend request to this user.');
      } else {
        console.error('Error :', error);
        Alert.alert('Error', 'There was an error ');
      }
    }
  };

  return (
    <View style={styles.container}>
      <Text style={styles.appName}>iMessage</Text>
      <View style={styles.buttonsContainer}>
        <TouchableOpacity
          style={styles.button}
          onPress={() => {
            navigation.navigate('AllRequests');
          }}
        >
          <Text style={styles.buttonText}>All Requests</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => {
            navigation.navigate('AllUnreadMessages');
          }}
        >
          <Text style={styles.buttonText}>Unread Messages</Text>
        </TouchableOpacity>
      </View>
      
      <TextInput
        style={styles.searchInput}
        placeholder="Search users..."
        value={searchQuery}
        onChangeText={setSearchQuery}
      />
      <FlatList
        data={filteredUsers}
        keyExtractor={(item) => item._id}
        renderItem={({ item }) => (
          <View style={styles.userContainer}>
            <Text style={styles.username}>{item.name}</Text>
            {!item.isFriend && (
              <TouchableOpacity
                style={styles.iconButton}
                onPress={() => sendFriendRequest(item._id)}
              >
                <Ionicons name="person-add" size={24} color="#007BFF" />
              </TouchableOpacity>
            )}
          </View>
        )}
      />

      <FooterMenuItem />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 16,
  },
  appName: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  },
  buttonsContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 16,
  },
  button: {
    backgroundColor: '#007BFF',
    padding: 8,
    borderRadius: 8,
    flex: 1,
    marginHorizontal: 4,
  },
  buttonText: {
    color: 'white',
    textAlign: 'center',
    fontWeight: 'bold',
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 16,
  },
  sectionTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 8,
  },
  searchInput: {
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    borderRadius: 8,
    paddingHorizontal: 10,
    marginBottom: 16,
  },
  userContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 16,
  },
  username: {
    fontSize: 16,
  },
  iconButton: {
    padding: 8,
  },
});

export default UsersScreen;
